export default {

    /** Twitter Launches Spacex */
    getTwitterLaunches: () => {
        return fetch("http://localhost:4000/twitter-tweets")
            .then(res => res.json())
            .catch({ status: 500, message: 'Internal Server Error' });
    }
}
